/* eslint-disable */
/* tslint:disable */
// @ts-nocheck
import React, { ReactNode, HTMLAttributes } from 'react';
import { createComponent } from '../lib';
import type { JSX } from '@vime/core/dist/types';

import { 
  VmVimeo,
  VmEmbed 
} from '@vime/core';

import { define } from '../lib';


define('vm-vimeo', VmVimeo);
define('vm-embed', VmEmbed);


export interface VimeoProps extends JSX.VmVimeo, HTMLAttributes<HTMLVmVimeoElement> {
  children?: ReactNode | ReactNode[]
};

export default createComponent<HTMLVmVimeoElement, VimeoProps>(
  'vm-vimeo',
  new Set(['videoId','byline','color','portrait','noAutoAspectRatio','poster','cookies','language','aspectRatio','autoplay','controls','logger','loop','muted','playsinline']),
);
